import React, { useRef, useState } from 'react';
import { Swiper, SwiperSlide } from 'swiper/react';

import 'swiper/css';
import 'swiper/css/pagination';
import 'swiper/css/navigation';

import '../../styles.css';

import { Pagination, Navigation } from 'swiper/modules';

import { CustomSwiperSlide, Container, AddButton, SlideContent } from './CarroselStyle';

export function SwiperNav() {
  const [swiperRef, setSwiperRef] = useState(null);
  const [slides, setSlides] = useState([
    { id: 1, name: 'Slide 1', link: 'https://example.com' },
    { id: 2, name: 'Slide 2', link: 'https://example.com' },
    { id: 3, name: 'Slide 3', link: 'https://example.com' },
    { id: 4, name: 'Slide 4', link: 'https://example.com' }
  ]);

  const handleAddPage = () => {
    const name = prompt('Digite o nome da p치gina:');
    const link = prompt('Digite o link da p치gina:');
    if (name && link) {
      const newSlide = {
        id: slides.length + 1,
        name: name,
        link: link
      };
      setSlides([...slides, newSlide]);
    }
  };

  return (
    <>
      <Swiper
        spaceBetween={50}
        slidesPerView={1}
        style={{ width: '100%', maxWidth: '600px' }}
      >
        {slides.map((slide) => (
          <SwiperSlide key={slide.id}>
            <CustomSwiperSlide>
              <SlideContent>
                <h2>{slide.name}</h2>
                <a href={slide.link} target="_blank" rel="noopener noreferrer">
                  Abrir Link
                </a>
              </SlideContent>
              <AddButton onClick={handleAddPage}>+</AddButton>
            </CustomSwiperSlide>
          </SwiperSlide>
        ))}
      </Swiper>
    </>
  );
}
